INSERT INTO `info` (`infoID`, `title`, `infoDetail`, `pic`, `adminID`, `date`, `section`) VALUES
(12, 'Insulin', 'Reusing syringes may help you cut costs, avoid buying large supplies of syringes, and reduce waste. However, talk with your doctor or nurse before you begin reusing. They can help you decide whether it would be a safe choice for you. If you are ill, have open wounds on your hands, or have poor resistance to infection, you should not risk insulin syringe reuse. Syringe makers will not guarantee the sterility of syringes that are reused.\r\n\r\nHere are some tips to keep in mind when reusing syringes:\r\n\r\n    Keep the needle clean by keeping it capped when you''re not using it.\r\n    Never let the needle touch anything but clean skin and the top of the insulin bottle.\r\n    Never let anyone use a syringe you''ve already used, and don''t use anyone else''s syringe.\r\n    Cleaning it with alcohol removes the coating that helps the needle slide into the skin easily.\r\n', , 'zati3', '2017-07-25', 'treatment');
INSERT INTO `info` (`infoID`, `title`, `infoDetail`, `pic`, `adminID`, `date`, `section`) VALUES
(13, 'Diabetes Type 1', 'Type 1 diabetes is usually diagnosed in children and young adults, and was previously known as juvenile diabetes. Only 5% of people with diabetes have this form of the disease.\r\nIn type 1 diabetes, the body does not produce insulin. The body breaks down the sugars and starches you eat into a simple sugar called glucose, which it uses for energy. Insulin is a hormone that the body needs to get glucose from the bloodstream into the cells of the body. With the help of insulin therapy and other treatments, even young children can learn to manage their condition and live long, healthy lives.\r\n', , 'zati3', '2017-07-12', 'what'),
(15, 'What Causes Diabetes?', 'Your pancreas makes a hormone called insulin. It is what lets your cells turn glucose from the food you eat into energy. People with type 2 diabetes make insulin, but their cells do not use it as well as they should. Doctors call this insulin resistance.\r\n\r\nAt first, the pancreas makes more insulin to try to get glucose into the cells. But eventually it cannot keep up, and the sugar builds up in your blood instead.\r\n\r\nUsually a combination of things cause type 2 diabetes, including:\r\n\r\nGenes. Scientists have found different bits of DNA that affect how your body makes insulin.\r\n\r\nExtra weight. Being overweight or obese can cause insulin resistance, especially if you carry your extra pounds around the middle. Now type 2 diabetes affects kids and teens as well as adults, mainly because of childhood obesity.\r\n\r\nMetabolic syndrome. People with insulin resistance often have a group of conditions including high blood glucose, extra fat around the waist, high blood pressure, and high cholesterol and triglycerides.\r\n\r\nToo much glucose from your liver. When your blood sugar is low, your liver makes and sends out glucose. After you eat, your blood sugar goes up, and usually the liver will slow down and store its glucose for later. But some peoples livers do nott. They keep cranking out sugar.\r\n\r\nBad communication between cells. Sometimes cells send the wrong signals or do not pick up messages correctly. When these problems affect how your cells make and use insulin or glucose, a chain reaction can lead to diabetes.\r\n\r\nBroken beta cells. If the cells that make the insulin send out the wrong amount of insulin at the wrong time, your blood sugar gets thrown off. High blood glucose can damage these cells, too.', , 'zati3', '2017-07-12', 'what'),
(16, 'symptoms of type 1 diabetes', 'Typical symptoms of type 1 diabetes are:\r\n\r\nfeeling very thirsty\r\npassing urine more often than usual, particularly at night\r\nfeeling very tired\r\nweight loss and loss of muscle bulk\r\nThe symptoms of type 1 diabetes usually develop very quickly in young people (over a few days or weeks). In adults, the symptoms often take longer to develop (a few months).', '', 'zati3', '2017-07-12', 'symptom'),
(17, 'Type 1 Diabetes', 'Diabetes is a lifelong condition that causes a persons blood sugar (glucose) level to become too high.\r\n\r\nThe hormone insulin, produced by the pancreas, is responsible for controlling the amount of glucose in the blood.\r\n\r\nThere are two main types of diabetes:\r\n\r\ntype 1  where the pancreas does not produce any insulin\r\ntype 2  where the pancreas doesnot produce enough insulin or the bodys cells do not react to insulin\r\nThese pages are about type 1 diabetes. Other types of diabetes are covered separately (read about type 2 diabetes, and gestational diabetes, which affects some women during pregnancy).\r\n\r\nSymptoms of diabetes\r\n\r\nTypical symptoms of type 1 diabetes are:\r\n\r\nfeeling very thirsty\r\npassing urine more often than usual, particularly at night\r\nfeeling very tired\r\nweight loss and loss of muscle bulk\r\nThe symptoms of type 1 diabetes usually develop very quickly in young people (over a few days or weeks). In adults, the symptoms often take longer to develop (a few months).', , 'zati3', '2017-07-12', 'what'),
(18, ' diabetes food', 'makan', , 'zati3', '2017-07-26', 'news');

